import React from 'react';
import ReactDOM from 'react-dom/client';
import { createBrowserRouter, RouterProvider } from 'react-router-dom'

import { Provider } from 'react-redux'

import Root from './Root';
import BaseError from './error/BaseError'
import Form from './Form/Form';
import GridCard from './Card/GridCard';
import ResolutionForm from './resolution/ResolutionForm';
import './styles/App.module.css'


let router = createBrowserRouter([
  {
    path: '/home',
    element: <Root component={<GridCard/>}/>,
    errorElement: <BaseError/>
  },
  {
    path: '/create',
    element: <Root component={<Form/>}/>,
    errorElement: <BaseError/>
  },
  {
    path: '/resolution',
    element: <Root component={<ResolutionForm/>} />,
    errorElement: <BaseError />
  }
])



const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    {/* <Provider store={store}> */}
      <RouterProvider router={router} />
      {/* <App /> */}
    {/* </Provider> */}
  </React.StrictMode>
);
